 <script>
    var table, tr, tds, td, listen, span; 
    listen = document.querySelector('[data-key="mycourses"]');
    span = listen.getElementsByClassName("media"); 
     span[0].setAttribute('class', 'dropdown-toggle');


    listen.addEventListener("click", myScript);

function myScript() {
    table = document.getElementById("nav-drawer");
    tr = table.getElementsByClassName("list-group");
    for (i = 0; i < tr.length; i++) {
      tds = tr[i].getElementsByClassName("list-group-item");

      for (j = 0; j < tds.length; j++) { 
	  var child = tds[j].getAttribute("data-key");
      var has = /[1-9]/g;
	  
          if (child.match(has )) {
             if(tds[j].getAttribute('style')){
                tds[j].setAttribute('style','');
             }else{
                tds[j].style.display = "block";

             }

           } 
      }      
    }
 }  

   </script>